OBD2 オートパワーウィンドウ T01<BR>
『簡単取付！』
キーロック連動でパワーウィンドウが自動で全閉するオートパワーウィンドウユニット登場！
窓を開けたまま降りてもリモコンキーロックで窓を全閉め！これは使ってみるとかなり便利です！
これからのシーズンにあったら便利なおすすめアイテムです♪ 
